const Awards = (props) => {
    //Award generation
    var awardArray = props.awards.split(',');
    var col1 = [];
    for (var i=0; i<awardArray.length; i++){
        var pointsArray = awardArray[i].split('-');
        col1.push(<p><b style={{color:'black'}}>{pointsArray[0]}</b></p>);
        col1.push(<div style={{height:'0px',width:'100%'}}></div>);
        for (var j=1; j<pointsArray.length; j++){
            col1.push(<p>{pointsArray[j]} </p>);
            col1.push(<div style={{height:'0px',width:'100%'}}></div>);
        }
        if(i!=awardArray.length-1){
            col1.push(<div style={{height:'0px',width:'100%',border: '1px solid green'}}></div>);
            col1.push(<div style={{height:'0px',width:'100%'}}></div>);
        }
    }

    return (
    <div className="row bound" style={{paddingLeft:'28px',paddingRight:'28px'}}>
        {col1}
    </div>
    )
}

export default Awards
